import { Link } from 'react-router-dom'

export default class Message extends Component {
    render() {
        return (
            <div>
                <ul>
                    <li>
                        <Link to="/homemessage/message1">message001</Link>&nbsp;&nbsp;
                    </li>
                    <li>
                        <Link to="/message2">message002</Link>&nbsp;&nbsp;
                    </li>
                    <li>
                        <Link to="/message/3">message003</Link>&nbsp;&nbsp;
                    </li>
                </ul>
                <hr />

            </div>
        )
    }
}
